static int
rand_int(int n)
{
  int limit = RAND_MAX - RAND_MAX % n;
  int rnd;

  do {
    rnd = libmin_rand();
  } 
  while (rnd >= limit);
  return rnd % n;
}

void
fy_shuffle(int *array, int n)
{
  int i, j, tmp;

  for (i = n - 1; i > 0; i--)
  {
    j = rand_int(i + 1);
    libmin_assert(i >= 0 && i < n && j >= 0 && j < n);
    tmp = array[j];
    array[j] = array[i];
    array[i] = tmp;
  }
}

void
print(const char *prefix, int *array, int n)
{
  libmin_printf("%s", prefix);
  for (int i = 0; i < n; i++)
    libmin_printf("%2d ", array[i]);
  libmin_printf("\n");
}

