double myfabs(double num)
{
  if (num < 0.0)
    return -num;
  else
    return num;
}

double rn_solver(int *converged, double maxerr, unsigned maxiter, fn_type f, fn_type df)
{
  unsigned iter;
  double guess = 1.0;

  *converged = FALSE;
  for (iter = 0; iter < maxiter; iter++)
  {
      *converged = myfabs(f(guess)) <= maxerr;
      if (*converged)
        break;
      guess = guess - f(guess)/df(guess);
  }
    return guess;
}

