void
knapSack(int wt[], int val[], int K[N+1][W+1])
{
  int i, w;

    for (i = 0; i <= N; i++)
  {
    for (w = 0; w <= W; w++)
    {
      if (i==0 || w==0)
        K[i][w] = 0;
      else
