					libmin_printf("%s\n",USAGE);
					libmin_fail(1);
			}
		break;
	}

	if(j >= argc){
						n = 45457;
	}
	else
	  n = libmin_atoi(argv[j++]);

	if(n == 0){
		libmin_printf("totient: not defined for n = 0.\n");
		return 1;
	}

	libmin_printf("phi(%d) = %d\n",n,phi(n));

  libmin_success();
	return 0;
}

