/**
 * Function to convert given Euler angles to a quaternion.
 * \f{eqnarray*}{
 * q_{0} & =
 * &\cos\left(\frac{\phi}{2}\right)\cos\left(\frac{\theta}{2}\right)\cos\left(\frac{\psi}{2}\right)
 * +
 * \sin\left(\frac{\phi}{2}\right)\sin\left(\frac{\theta}{2}\right)\sin\left(\frac{\psi}{2}\right)\\
 * q_{1} & =
 * &\sin\left(\frac{\phi}{2}\right)\cos\left(\frac{\theta}{2}\right)\cos\left(\frac{\psi}{2}\right)
 * -
 * \cos\left(\frac{\phi}{2}\right)\sin\left(\frac{\theta}{2}\right)\sin\left(\frac{\psi}{2}\right)\\
 * q_{2} & =
 * &\cos\left(\frac{\phi}{2}\right)\sin\left(\frac{\theta}{2}\right)\cos\left(\frac{\psi}{2}\right)
 * +
 * \sin\left(\frac{\phi}{2}\right)\cos\left(\frac{\theta}{2}\right)\sin\left(\frac{\psi}{2}\right)\\
 * q_{3} & =
 * &\cos\left(\frac{\phi}{2}\right)\cos\left(\frac{\theta}{2}\right)\sin\left(\frac{\psi}{2}\right)
 * -
 * \sin\left(\frac{\phi}{2}\right)\sin\left(\frac{\theta}{2}\right)\cos\left(\frac{\psi}{2}\right)\\
 * \f}
 *
 * @param [in] in_euler input Euler angles instance
 * @returns converted quaternion
 */
quaternion quat_from_euler(const euler *in_euler)
{
    quaternion out_quat = {{0.0}, {{0.0, 0.0, 0.0}}}; 

    if (!in_euler)      {
        libmin_printf("%s: Invalid input.", __func__);
        return out_quat;
    }

    quaternion temp;

    double cy = libmin_cos(in_euler->yaw * 0.5);
    double sy = libmin_sin(in_euler->yaw * 0.5);
    double cp = libmin_cos(in_euler->pitch * 0.5);
    double sp = libmin_sin(in_euler->pitch * 0.5);
    double cr = libmin_cos(in_euler->roll * 0.5);
    double sr = libmin_sin(in_euler->roll * 0.5);

    temp.w = cr * cp * cy + sr * sp * sy;
    temp.q1 = sr * cp * cy - cr * sp * sy;
    temp.q2 = cr * sp * cy + sr * cp * sy;
    temp.q3 = cr * cp * sy - sr * sp * cy;

    return temp;
}

/**
 * Function to convert given quaternion to Euler angles.
 * \f{eqnarray*}{
 * \phi & = &
 * \tan^{-1}\left[\frac{2\left(q_0q_1+q_2q_3\right)}{1-2\left(q_1^2+q_2^2\right)}\right]\\
 * \theta & =
 * &-\sin^{-1}\left[2\left(q_0q_2-q_3q_1\right)\right]\\
 * \psi & = &
 * \tan^{-1}\left[\frac{2\left(q_0q_3+q_1q_2\right)}{1-2\left(q_2^2+q_3^2\right)}\right]\\
 * \f}
 *
 * @param [in] in_quat input quaternion instance
 * @returns converted euler angles
 */
euler euler_from_quat(const quaternion *in_quat)
{
    euler out_euler = {{0.0}, {0.0}, {0.0}};
    if (!in_quat)      {
        libmin_printf("%s: Invalid input.", __func__);
        return out_euler;
    }

    out_euler.roll = libmin_atan2(
        2.0 * (in_quat->w * in_quat->q1 + in_quat->q2 * in_quat->q3),
        1.0 - 2.0 * (in_quat->q1 * in_quat->q1 + in_quat->q2 * in_quat->q2));
    out_euler.pitch =
        libmin_asin(2.0 * (in_quat->w * in_quat->q2 + in_quat->q1 * in_quat->q3));
    out_euler.yaw = libmin_atan2(
        2.0 * (in_quat->w * in_quat->q3 + in_quat->q1 * in_quat->q2),
        1.0 - 2.0 * (in_quat->q2 * in_quat->q2 + in_quat->q3 * in_quat->q3));

    return out_euler;
}

/**
 * Function to multiply two quaternions.
 * \f{eqnarray*}{
 * \mathbf{c} & = & \mathbf{a}\otimes\mathbf{b}\\
 * & = & \begin{bmatrix}a_{0} & a_{1} & a_{2} &
 *  a_{3}\end{bmatrix}\otimes\begin{bmatrix}b_{0} & b_{1} & b_{2} &
 *  b_{3}\end{bmatrix}\\
 * & = &
 * \begin{bmatrix}
 *  a_{0}b_{0}-a_{1}b_{1}-a_{2}b_{2}-a_{3}b_{3}\\
 *  a_{0}b_{1}+a_{1}b_{0}+a_{2}b_{3}-a_{3}b_{2}\\
 *  a_{0}b_{2}-a_{1}b_{3}+a_{2}b_{0}+a_{3}b_{1}\\
 *  a_{0}b_{3}+a_{1}b_{2}-a_{2}b_{1}+a_{3}b_{0}
 * \end{bmatrix}^{T}
 * \f}
 *
 * @param [in] in_quat1 first input quaternion instance
 * @param [in] in_quat2 second input quaternion instance
 * @returns resultant quaternion
 */
quaternion quaternion_multiply(const quaternion *in_quat1,
                               const quaternion *in_quat2)
{
    quaternion out_quat = {{0.0}, {{0.0, 0.0, 0.0}}}; 
    if (!in_quat1 || !in_quat2)      {
        libmin_printf("%s: Invalid input.", __func__);
        return out_quat;
    }

    out_quat.w = in_quat1->w * in_quat2->w - in_quat1->q1 * in_quat2->q1 -
                 in_quat1->q2 * in_quat2->q2 - in_quat1->q3 * in_quat2->q3;
    out_quat.q1 = in_quat1->w * in_quat2->q1 + in_quat1->q1 * in_quat2->w +
                  in_quat1->q2 * in_quat2->q3 - in_quat1->q3 * in_quat2->q2;
    out_quat.q2 = in_quat1->w * in_quat2->q2 - in_quat1->q1 * in_quat2->q3 +
                  in_quat1->q2 * in_quat2->w + in_quat1->q3 * in_quat2->q1;
    out_quat.q3 = in_quat1->w * in_quat2->q3 + in_quat1->q1 * in_quat2->q2 -
                  in_quat1->q2 * in_quat2->q1 + in_quat1->q3 * in_quat2->w;

    return out_quat;
}

/** @} */

static void test()
{
    quaternion quat = {{0.7071}, {{0.7071, 0.0, 0.0}}};
    euler eul = euler_from_quat(&quat);
    libmin_printf("Euler: %.4lf, %.4lf, %.4lf\n", eul.pitch, eul.roll, eul.yaw);

    quaternion test_quat = quat_from_euler(&eul);
    libmin_printf("Quaternion: %.4lf %+.4lf %+.4lf %+.4lf\n", test_quat.w,
           test_quat.dual.x, test_quat.dual.y, test_quat.dual.z);

    libmin_assert(libmin_fabs(test_quat.w - quat.w) < .01);
    libmin_assert(libmin_fabs(test_quat.q1 - quat.q1) < .01);
    libmin_assert(libmin_fabs(test_quat.q2 - quat.q2) < .01);
    libmin_assert(libmin_fabs(test_quat.q3 - quat.q3) < .01);
    libmin_printf("All tests passed!\n");
}

int main()
{
    test();

    libmin_success();
    return 0;
}

/* pascal.c: print rows of Pascal's triangle to stdout. The algorithm
             is simply to generate successive rows iteratively using the
             defining property of pascal's triangle:

			C(n,k) = C(n-1,k-1) + C(n-1,k).

	     The program is written for simplicity rather than efficiency.

	     The only tricky thing is getting the display to look right.
             We provide an option -c to compute the number of display
             columns needed without doing the display itself. 

	     Author: Terry R. McConnell

	     Compile: cc -o pascal pascal.c
*/

#include "libmin.h"

#define PROGRAM_NAME "pascal"
#define VERSION "1.0"
#define MAX_ROWS 30
#define USAGE "usage: pascal [ -h -v] [-c rows] rows\n"
#define HELP "\n\npascal [-h -v] [-c n] n \n\
print the first n rows of pascal's triangle to stdout.\n\
-h: print this helpful information\n\
-v: print version number and exit\n\
-c: print the number of columns required for display only \n\n"

static int triangle[MAX_ROWS + 1][MAX_ROWS];

/* num_digits: count how man digits the argument has and return that number */

int num_digits(int n) {

	int d = 1;


	while((n=n/10) != 0)
    d++;
	return d;
}

/* print_centered: print the first argument centered in a field of 
	width given by the second argument, to the extent possible.
	(The width is always the second argument, but the number may not
        be quite centered, depending on parity.) 
	Return 0 if successful and 1 if not.
*/

int print_centered(int n, int width)
{
	int nw;
	int pad_space;
	int i;

	nw = num_digits(n);
	if(width < nw) return 1;  /* no can do */

	pad_space = (width - nw)/2;

	for(i=0;i<pad_space;i++)
	  libmin_printf(" ");
	libmin_printf("%d",n);
	for(i=0;i<width - nw - pad_space;i++)
	  libmin_printf(" ");
	return 0;
}

int main(void)
{
	int argc=1; char **argv=NULL;
	int i=1,j;
	int cols_option = FALSE;
	int nrows;
	int max_width;
	int row_offset;

	/* Process command line */

	while(((i+1)<=argc)&&(argv[i][0] == '-')){
		if(argv[i][1] == 'h'){
			libmin_printf(HELP);
			return 0;
		}
		if(argv[i][1] == 'v'){
			libmin_printf("%s\n",VERSION);
			return 0;
		}
		if(argv[i][1]=='c'){
			/* make sure there is an arg */
			if((i+1) >= argc){
				libmin_printf(USAGE);
				return 1;
			}
			cols_option = TRUE;
			i++;
			continue;
		}
		/* Unknown option if we got to here */
		libmin_printf(USAGE);
		return 1;
	}

	/* Make sure there is one arg left */

	if((i+1) != argc){ 
	  nrows = 20;
	}
	else
	  nrows = libmin_atoi(argv[i]);

	/* Sanity checks */
	if(nrows == 0){ 
		if(cols_option)
		  libmin_printf("0\n");
		libmin_success(); /* nothing to do */
	}
	if(nrows < 0){
		libmin_printf("%s: %d is an invalid number of rows\n", PROGRAM_NAME,nrows);
		libmin_fail(1);
	}
	if(nrows > MAX_ROWS){
		libmin_printf("%s: %d > %d rows maximum\n",PROGRAM_NAME,nrows, MAX_ROWS);
		libmin_fail(1);
	}

	/* build the triangle */

	triangle[0][0] = 1;
	for(i=1;i<nrows;i++){
		triangle[i][0] = 1;
		for(j=1;j<i;j++)
			triangle[i][j] = triangle[i-1][j-1]
				+ triangle[i-1][j];
		triangle[i][i] = 1;
	}

	/* Find the widest number in table. It's the middle one in
           the bottom row */

	max_width = num_digits(triangle[nrows-1][nrows/2]);

	/* make sure this value is even */
	if(max_width % 2) max_width++;

	/* Since each number is printed in a field max_width+2 wide
	   and there are nrows numbers in the longest (bottom) row
           the number of columns needed for the display is
           (max_width+2)*nrows */

	if(cols_option){
			libmin_printf("%d\n",(max_width + 2)*nrows);
			libmin_success();
	}

	/* Now print everything out */ 

	for(i=0;i<nrows;i++){

		/* This is the only tricky part. Think of each number as
                   being printed in the center of a brick. Each brick has
                   width max_width/2 + 1. Going down one row, the bricks
                   move over one half width */

		row_offset = (nrows-i-1)*(max_width/2+1);

		/* Move first row in deepest, etc., by printing the approp.
                   number of leading blanks */

		for(j=0;j<row_offset;j++)
		  libmin_printf(" ");

		/* Print ith row of numbers */

		for(j=0;j<i+1;j++)
			if( print_centered(triangle[i][j],max_width+2)){
				libmin_printf("%s: error printing element %d,%d\n",PROGRAM_NAME,i,j);
				libmin_fail(1);
		}
		libmin_printf("\n");
	}

  libmin_success();
	return 0;
}

#include "libmin.h"

static int64_t bplong;
static int64_t base[2048];

/*************************/
/*  Heap Sort Program    */
/*************************/

int
HSORT(int64_t m, int64_t p)
{
  int64_t i,j,k,l;
  int64_t size;

  int64_t  msize, iran, ia, ic, im, ih, ir;
  int64_t  count, ca;

  msize = m * bplong;
  size  = m - 1;

  if (m >= 2048)
    {
      libmin_printf("base buffer overflow!\n");
      libmin_fail(1);
    }

  ia = 106;
  ic = 1283;
  im = 6075;
  ih = 1001;

  count = 0;

  iran = 47;                        /* Fill with 'random' numbers */
  for(i=1 ; i<=size ; i++)
    {
      iran = (iran * ia + ic) % im;
      *(base+i) = 1 + (ih * iran) / im;
    }

  k = (size >> 1) + 1;              /* Heap sort the array */
  l = size;
  ca = 0;

  for (;;)
    {
      if (k > 1)
	{
	  ir = *(base+(--k));
	}
      else
	{
	  ir = *(base+l);
	  *(base+l) = *(base+1);
	  if (--l == 1)
	    {
	      *(base+1) = ir;
	      goto Done;
	    }
	}

      i = k;
      j = k << 1;

      while (j <= l)
	{
	  if ( (j < l) && (*(base+j) < *(base+j+1)) ) ++j;
	  if (ir < *(base+j))
	    {
	      *(base+i) = *(base+j);
	      j += (i=j);
	    }
	  else
	    {
	      j = l + 1;
	    }
	}
      *(base+i) = ir;
    }
 Done:
  count = count + ca;

  /* Scale runtime per iteration */
  ir = count;
  ir = (ir + ca) / 2;

  if ( p != 0L )
    libmin_printf("   %10ld\n", (int)msize);

  /* check the array */
  for(i = 0; i < size-1; i++)
    {
      if (base[i] > base[i+1])
      {
        libmin_printf("ERROR: base array is not properly sorted!\n");
        libmin_fail(1);
      }
    }
  libmin_printf("INFO: base array is properly sorted!\n");

  return 0;
}

int
main(void)
{
  int64_t  j, p;

  bplong = sizeof(int64_t);

  libmin_printf("\n   Heap Sort C Program\n");
  libmin_printf("   Size of long (bytes): %ld\n\n", (long)bplong);
  libmin_printf("   Array Size (bytes)\n");

				   /* Predetermine runtime (sec) for  */
				   /* memory size 2000 * sizeof(long),*/
				   /* and 256 iterations. p = 0 means */
				   /* don't print the result.         */
  j = 1024;
  p = 1;
  HSORT(j,p);

  libmin_success();
  return 0;
}

#include "libmin.h"

		     /***********************************************/
#define LIMIT 8      /* You may need to change this to '3' for PC's */
		     /* and Clones or you can experiment with higher*/
		     /* values, but '13' is currently the max.      */
		     /***********************************************/
static long L_Prime,N_Prime;      /* Last Prime and Number of Primes Found */

static char flags[8192];

void err(char* s);

/**************************************/
/*  Sieve of Erathosthenes Program    */
/**************************************/

static int
SIEVE(long m, long p)
{
  register long i,prime=0,k;
  register long count,size;
  long j;

  size  = m - 1;

  N_Prime   = 0L;
  L_Prime   = 0L;

  j = 0;

      count = 0;

      for(i=0 ; i<=size ; i++)
	{
	  *(flags+i) = TRUE;                                /* 1*size  */
	}                                                 /* 3*size  */

      for(i=0 ; i<=size ; i++)
	{
	  if(*(flags+i))                                /* 2*size  */
	    {                                             /* 1*count */
	      count++;                                      /* 1*count */
	      prime = i + i + 3;                            /* 3*count */
	      for(k = i + prime ; k<=size ; k+=prime)     /* 3*count */
		{
		  *(flags+k)=FALSE;                           /* 1*ci    */
		}                                           /* 3*ci    */
	      /* 1*count */
	    }
	}                                               /* 3*size  */

      j = j + count;

  N_Prime = j ;
  L_Prime = prime;

  if (p != 0L)
    libmin_printf("  %9ld   %8ld     %8ld\n",m,N_Prime,L_Prime);

  return 0;
}

int
main(void)
{

  long  j,p;

  libmin_printf("\n   Sieve of Eratosthenes (Scaled to 10 Iterations)\n");
  libmin_printf("   Version 1.2b, 26 Sep 1992\n\n");
  libmin_printf("   Array Size   Number   Last Prime\n");
  libmin_printf("    (Bytes)   of Primes\n");

  j = 1024;
  p = 1;
  SIEVE(j,p);

  libmin_success();
  return 0;
}
